declare function _NS(localName: string): string;
/**
 * This extension adds predicates making explicit some implicit knowledge in the Workspace ontology.
 */
declare const WS: {
    PREFIX: string;
    NAMESPACE: string;
    PREFIX_AND_NAMESPACE: {
        ws: string;
    };
    NS: typeof _NS;
    /**
     * A file describing a configuration. In this context, it is
   expected to describe the workspace configuration.
     *
     * This term provides multilingual descriptions, but has a mismatch between its labels and comments, with [2] labels in languages [en, fr], but [1] comment in the language [en].
     */
    ConfigurationFile: string;
    /**
     * A  storage is a space of URIs in which you can individually control for each resource
      who has access to it.
  
     *
     * This term provides descriptions only with no explicit locale.
     */
    ControlledStorage: string;
    /**
     * A storage is a space of URIs in which you have access to data.
  
     *
     * This term provides descriptions only with no explicit locale.
     */
    Storage: string;
    /**
     * This is a workspace for storing the
      information about the other workspaces.
      As a user, you normally don't have to worry about it.
     *
     * The term has a description only in English, with [1] label in the language [en], but [1] comment in the language [NoLocale] (so the difference is only between English and NoLocale, which we consider the same).
     */
    MasterWorkspace: string;
    /**
     * Access only by the you, the user.
     *
     * This term provides descriptions only with no explicit locale.
     */
    PrivateWorkspace: string;
    /**
     * Workspaces are place where data is stored, and associated polices of privacy.
  A given application typically stores information in several different
  workspaces, some being user private, some shared, and some public.
  
     *
     * This term provides descriptions only with no explicit locale.
     */
    Workspace: string;
    /**
     * A personal storage is a space of URIs in which you and only you have access to data,
      you cannot give access to anyone else.
  
     *
     * This term provides descriptions only with no explicit locale.
     */
    PersonalStorage: string;
    /**
     * Aceess may not be open to the public. Contains preferences resources.
     *
     * This term provides descriptions only with no explicit locale.
     */
    PreferencesWorkspace: string;
    /**
     * Access is to some but not all people.
     *
     * This term provides descriptions only with no explicit locale.
     */
    SharedWorkspace: string;
    /**
     * A public storage is a space of URIs in which you have access to data,
      and all data is accessible to anyone without control.
  
     *
     * This term provides descriptions only with no explicit locale.
     */
    PublicStorage: string;
    /**
     * Aceess is open to the public. Anything in a public workspace
      can be accesed by anyone.
     *
     * This term provides descriptions only with no explicit locale.
     */
    PublicWorkspace: string;
    /**
     * master workspace
     *
     * This term has a label (in language [en]), but no long-form descriptions at all (i.e., the vocabulary doesn&#x27;t provide any &#x27;rdfs:comment&#x27; or &#x27;dcterms:description&#x27; meta-data).
     */
    masterWorkspace: string;
    /**
     * preferences file
     *
     * This term has a label (in language [NoLocale]), but no long-form descriptions at all (i.e., the vocabulary doesn&#x27;t provide any &#x27;rdfs:comment&#x27; or &#x27;dcterms:description&#x27; meta-data).
     */
    preferencesFile: string;
    /**
     * The storage in which this workspace is, or the storage which
  contains this resource, or a storage available to this agent to use.
     *
     * This term provides descriptions only with no explicit locale.
     */
    storage: string;
    /**
     * URIs which start with this string are in this workspace or storage.
  This may be used for constructing URIs for new storage resources.
  
     *
     * This term provides descriptions only with no explicit locale.
     */
    uriPrefix: string;
    /**
     * workspace
     *
     * This term has a label (in language [en]), but no long-form descriptions at all (i.e., the vocabulary doesn&#x27;t provide any &#x27;rdfs:comment&#x27; or &#x27;dcterms:description&#x27; meta-data).
     */
    workspace: string;
};
export default WS;
